import React, { useState, useEffect } from 'react';

const RelationModal = ({ mainTable, relatedTable, mainId, title, onClose }) => {
  const [relatedData, setRelatedData] = useState([]);
  const [availableData, setAvailableData] = useState([]);
  const [selectedId, setSelectedId] = useState(null);
  const [errorMessage, setErrorMessage] = useState('');

  useEffect(() => {
    fetchRelatedData();
    fetchAvailableData();
  }, [mainId]);

  const fetchRelatedData = () => {
    fetch(`http://localhost:5000/api/${mainTable}/${relatedTable}/${mainId}`)
      .then((response) => {
        if (!response.ok) throw new Error('Erro ao buscar relacionamentos existentes.');
        return response.json();
      })
      .then((data) => setRelatedData(data))
      .catch((err) => setErrorMessage(err.message));
  };

  const fetchAvailableData = () => {
    fetch(`http://localhost:5000/api/${mainTable}/${relatedTable}/${mainId}/available`)
      .then((response) => {
        if (!response.ok) throw new Error('Erro ao buscar dados disponíveis.');
        return response.json();
      })
      .then((data) => setAvailableData(data))
      .catch((err) => setErrorMessage(err.message));
  };

  const handleAddRelation = () => {
    fetch(`http://localhost:5000/api/${mainTable}/${relatedTable}`, {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ mainId, relatedId: selectedId }),
    })
      .then((response) => {
        if (!response.ok) throw new Error('Erro ao adicionar relacionamento.');
        fetchRelatedData();
        fetchAvailableData();
        alert('Relacionamento adicionado com sucesso!');
      })
      .catch((err) => setErrorMessage(err.message));
  };

  const handleDeleteRelation = (relatedId) => {
    fetch(`http://localhost:5000/api/${mainTable}/${relatedTable}`, {
      method: 'DELETE',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ mainId, relatedId }),
    })
      .then((response) => {
        if (!response.ok) throw new Error('Erro ao excluir relacionamento.');
        fetchRelatedData();
        fetchAvailableData();
        alert('Relacionamento excluído com sucesso!');
      })
      .catch((err) => setErrorMessage(err.message));
  };

  return (
    <div className="modal-overlay">
      <div className="modal-content">
        <h2>{title}</h2>
        {errorMessage && <p className="error-message">{errorMessage}</p>}

        <h3>Relacionados:</h3>
        <table>
          <thead>
            <tr>
              <th>ID</th>
              <th>Nome</th>
              <th>Ações</th>
            </tr>
          </thead>
          <tbody>
            {relatedData.map((item) => (
              <tr key={item.id}>
                <td>{item.id}</td>
                <td>{item.nome}</td>
                <td>
                  <button onClick={() => handleDeleteRelation(item.id)}>Excluir</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>

        <h3>Disponíveis:</h3>
        <select onChange={(e) => setSelectedId(e.target.value)}>
          <option value="">Selecione</option>
          {availableData.map((item) => (
            <option key={item.id} value={item.id}>
              {item.nome}
            </option>
          ))}
        </select>
        <button onClick={handleAddRelation}>Adicionar</button>

        <button onClick={onClose} style={{ marginTop: '20px' }}>Fechar</button>
      </div>
    </div>
  );
};

export default RelationModal;
